import React from "react";
import Expense from "./components/Expense";
const App = () => {

  const expense = [
    {
        id: 1,
        title: 'Buy Car',
        amount: 212.00,
        date: new Date(2021, 20, 10)
    },
    {
        id: 2,
        title: 'Car Asurance',
        amount: 200.00,
        date: new Date(2021, 10, 10)
    },
    {
        id: 3,
        title: 'Eat',
        amount: 10.00,
        date: new Date(2021, 9, 10)
    },
]
  return (
    <div>
        <h1>Lets Get Started</h1>
        <Expense item={expense}/>
    </div>
  );
}

export default App;
